import React, { Component } from "react";

const Champ = (props) => {
    return (
        <div>
            <label className="form-label" for={props.label}>{props.label}</label>
            <input id={props.name} type={props.type} name={props.name} class="form-control" value={props.value} placeholder={props.placeholder}></input>
        </div >
    );
};
export default Champ;
